import React from 'react';
import { Container } from './styles';
import { Doctor, Avatar } from '@bentcare/core';

const FifthSection: React.FC = () => {
  return (
    <Container>
      <h3>Fácil acesso à profissionais de qualidade</h3>
      <p>
        Encontre profissionais de referência com vasta experiência de mercado
      </p>
      <div>
        <Doctor
          card={true}
          fullWidth={false}
          avatar={
            <Avatar
              //  size={SIZES_TYPES.LARGE}
              src="https://avatars1.githubusercontent.com/u/18266600?s=400&u=a2949f8767da2f93d807f643f88bc8d3caf068ad&v=4"
              username="Marcelo Melo"
            />
          }
          name="Marcelo Melo"
          syndicateCode="CRM-SP 12312312"
          specialty="Especialidade Médica"
          quantityStars={3}
        />
      </div>
    </Container>
  );
};

export default FifthSection;
